//SPDX-License-Identifier: MIT

pragma solidity >=0.8.10 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
import "@divergencetech/contracts/sales/FixedPriceSeller.sol";
import "@divergencetech/contracts/erc721/BaseTokenURI.sol";

// Mint nft with a random metadata from IPFS
// Prices scale up every 500 mints by 0.05
// Fist 500 mints are free

contract Reference is ERC721, VRFConsumerBaseV2, FixedPriceSeller, BaseTokenURI {
    VRFCoordinatorV2Interface COORDINATOR;
    address vrfCoordinator;
    bytes32 keyHash;
    uint256 callBackGasLimit;
    uint16 requestConfirmations;
    uint32 numWords;

    constructor(
        address _VRFCoordinator, 
        bytes32 _keyHash,
        address payable beneficiary)
    ERC721("Frogxelz", "FROGXEL")
    VRFConsumerBaseV2(vrfCoordinator)
    BaseTokenURI("")
    FixedPriceSeller(
        0.01 ether, 
        Seller.SellerConfig({
            totalInventory: 500,
            lockTotalInventory: true,
            maxPerAddress: 5,
            maxPerTx: 1,
            freeQuota: 5,
            lockFreeQuota: false,
            reserveFreeQuota: true
        }),
        beneficiary
    ) {
        vrfCoordinator = _VRFCoordinator;
        keyHash = _keyHash;
        COORDINATOR  = VRFCoordinatorV2Interface(vrfCoordinator);
    }


    // on mint bu

    function fulfillRandomWords(uint256 requestId, uint256[] memory randomWords) internal override {
        uint256 randomNumber = randomWords[0];

    }

    function _handlePurchase(address to, uint256 n, bool freeOfCharge) internal override {
        _safeMint(to, n);
    }

    function _baseURI() internal view override(BaseTokenURI, ERC721) returns (string memory ) {
        return BaseTokenURI._baseURI();
    }
}
